import { Grid, Button, Typography } from '@material-ui/core';
import Icon from '@mdi/react';
import { mdiQrcode, mdiQrcodeScan } from '@mdi/js';
import { Link } from 'react-router-dom';

import './home.css';

function Home() {
  return (
    <div className='center'>
      <Typography style={{ margin: 30 }} variant='h2'>
        LAB EYES
      </Typography>

      <Grid rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
        <Grid item xs>
          <Link to='/qr_generator'>
            <Button variant='contained' size='large' color='primary'>
              <Icon
                style={{ padding: 10 }}
                path={mdiQrcode}
                title='QR Generator'
                size={10}
                color='white'
              />
            </Button>
          </Link>
        </Grid>
        <Grid item xs>
          <Link to='/qr_scanner'>
            <Button variant='contained' size='large' color='primary'>
              <Icon
                style={{ padding: 10 }}
                path={mdiQrcodeScan}
                title='QR Scanner'
                size={10}
                color='white'
              />
            </Button>
          </Link>
        </Grid>
      </Grid>
    </div>
  );
}

export default Home;
